import {BrowserRouter,Route,Routes}from 'react-router-dom'
import { Link } from "react-router-dom"
//stranice i komponente

import Home from './pages/Home';
import Navnar from './components/navbar';

function App() {
  return (
    <div className="App"
    style={{  height:100 ,
  backgroundImage: "url(" + " https://images.unsplash.com/photo-1553095066-5014bc7b7f2d?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8d2FsbCUyMGJhY2tncm91bmR8ZW58MHx8MHx8&w=1000&q=80 " + ")",
  backgroundPosition: 'center',
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat'
}}
    >
      <BrowserRouter>




      <div className='pages'>

      <Link to="/sirovine">

                <h1> Sirovine page</h1>
            </Link>

        <Routes>
          <Route
          path='/sirovine'
          element={<Home></Home>}
            />

        </Routes>

      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
